webpackJsonp([0xdee316319a58],{8553:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"I Have No Goat",date:"27 Jun 2004",slug:"/2004-06-27-i-have-no-goat/",tags:"Y2004"},html:'<p><em>Null Bock</em> is the German phrase that describes my mood today. It literally means "no goat", but in this case means I\'m feeling bored and apathetic.</p>\n<p>While on the subject of silly German phrases, it betrays my age pretty exactly to admit the first hip German word I learned was <em>Affentittengeil</em> (literally "monkey tits horny"), something  I haven\'t heard since the early \'80s. (Does that qualify me to march in the <a href="http://www.schlagermove.de/index.php?page=home&city=hamburg">Schlager Move</a> in Hamburg next weekend?)</p>'},next:{fields:{title:"Top Hat",date:"26 Jun 2004",slug:"/2004-06-26-top-hat/"}},previous:{fields:{title:"Pulling out of here to win",date:"29 Jun 2004",slug:"/2004-06-29-pulling-out-of-here-to-win/"}}},{node:{fields:{title:"Top Hat",date:"26 Jun 2004",slug:"/2004-06-26-top-hat/",tags:"Y2004"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2004/06/tophat.jpg" alt="Top Hat" /></p>\n<p>Today we celebrated the 90th birthday of Christopher\'s great-aunt Annelise. This is her just before my father-in-law\'s wedding in 1956. She\'s the one wearing his top hat.</p>'},next:{fields:{title:"For Housewives",date:"25 Jun 2004",slug:"/2004-06-25-for-housewives/"}},previous:{fields:{title:"I Have No Goat",date:"27 Jun 2004",slug:"/2004-06-27-i-have-no-goat/"}}},{node:{fields:{title:"For Housewives",date:"25 Jun 2004",slug:"/2004-06-25-for-housewives/",tags:"Y2004"},html:'<p><a href="http://arrog.antville.org/stories/831784/"><img src="http://www.papascott.de/wordpress/wp-content/uploads/2004/06/forhousewives.jpg" alt="" border="0" /></a></p>\n<p>Mobile computing anno 1967, at <a href="http://arrog.antville.org/stories/831784/">sofa</a></p>'},next:{fields:{title:"Manila: Converted",date:"24 Jun 2004",slug:"/2004-06-24-manila-converted/"}},previous:{fields:{title:"Top Hat",date:"26 Jun 2004",slug:"/2004-06-26-top-hat/"}}}],pathPrefix:"",first:!1,last:!1,index:461,pageCount:1101}}}});
